import React, { Component } from 'react'
import pinterest from '../icons/pinterest.png'
import insta from '../icons/instagram.png'

export default class Footer extends Component {
    render() {
        return (
            <div>
                <img src={pinterest}/>
                <img src={insta}/>
            </div>
        )
    }
}
